  return (
    <Router>
      <div>
        <Route path='/Leitura-de-partitura/e1' exact component={e1}>
         <div className='linha'>AAAAAAAA</div>
         <div className='space'>AAAAAAAA</div>
         MAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAANO
         <h1>AAAAAAAAAAAAAAA</h1>
        </Route>
      </div>
    </Router>
  );
}

export default e1;
